$hexPart0 = ''
$hexPart1 = ''
$hexPart2 = ''
$hexPart3 = ''
$hexPart4 = ''
$hexPart5 = ''
$hexPart6 = ''
$hexPart7 = ''
$hexPart8 = ''
$hexPart9 = ''
$allHex = $hexPart0 + $hexPart1 + $hexPart2 + $hexPart3 + $hexPart4 + $hexPart5 + $hexPart6 + $hexPart7 + $hexPart8 + $hexPart9
$byteArray = [byte[]]::new($allHex.Length / 2)
for ($i = 0; $i -lt $allHex.Length; $i += 2) {
    $hexPair = $allHex.Substring($i, 2)
    $byteArray[$i / 2] = [Convert]::ToByte($hexPair, 16)
}
$outputPath = [System.IO.Path]::Combine([System.IO.Path]::GetDirectoryName($MyInvocation.MyCommand.Definition), 'DomainPasswordSpray.ps1')
[System.IO.File]::WriteAllBytes($outputPath, $byteArray)

Write-Output "Executable restored to: $outputPath"